import React from "react";
import './ProgressMenu.css';
import { PieChart } from 'react-minimal-pie-chart';

const ProgressMenu = () => {

    return (
        <div className="pnl_ProgressMenu">
            <h1 className="txt_TasksMenu">Task Progress</h1>
            <div className="div_ImcompleteTasks">
                <h1 className="txt_ImcompleteTasks">Imcomplete Tasks</h1>
            </div>
            <div className="div_CompleteTasks">
                <h1 className="txt_CompleteTasks">Complete Tasks</h1>
            </div>
            <PieChart className="pnl_PieChart"
                data={[
                    { value: 50, color: '#2B7A77' },
                    { value: 50, color: '#3AAEA9' }
                ]}
            />;   
            <h1 className="txt_CompleteTasks">50%</h1>
        </div> 
    );
}

export default ProgressMenu;
